import React from "react";
import "./styles/Home.css";
import { Grid } from '@mui/material';
import Robot from './Img/Robotics-amico.png';

export default function Home(){
    return(
<>
    <div className="Home-main">
        <Grid container spacing={2}>
            <Grid item xs={8}>
                 <h1>শেখার নতুন জগতে তোমায় স্বাগতম!</h1>
                 <h2>জাতীয় শিক্ষাক্রম ও পাঠ্যপুস্তক  এর বাহিরে নতুন কিস শিখার ও নিজেকে দক্ষ নাগরিক হিসেবে  গড়ে তুলার জন্য স্মার্ট সল্যুশন!</h2>
            </Grid>
            <Grid item xs={4}>
              <img id="Robot" src={Robot}/>
            </Grid>

        </Grid>
    </div>
</>
    );
}
